import React from 'react';

const Dashboard = (props) =>{
    return(
        <div className="coinlist">
            <p>{props.rank}...
            {props.name}...
            {props.marketcap}...   
            {props.price}...
            {props.change}... 
            {props.vol}...
            {props.supply}...   </p>
        </div>
    )
}


export default Dashboard;
